import React from "react";

function Index() {
  return (
    <div className="flex flex-col items-center justify-center w-full min-h-screen p-4 space-y-4 max-w-screen">
      <h1 className="text-4xl font-semibold tracking-widest text-gray-700">
        Welcome
      </h1>
      <p className="max-w-lg tracking-widest text-justify text-gray-800">
        I'm Alex Bruns. This is my website. My old one was mostly work focused.
        You can find it{" "}
        <a
          href="https://alexbruns.dev"
          target="_blank"
          className="relative px-1 hover:text-white group"
        >
          <span className="absolute inset-0 z-0 -mx-px bg-blue-500 bg-opacity-25 group-hover:bg-opacity-75 highlight" />
          <style jsx>{`
            .highlight {
              transform: rotate(2deg);
            }
          `}</style>
          <span className="relative z-10">here</span>
        </a>
        . This new site is more focused on my personal work. You'll find info
        about <strong>books</strong> I'm reading, <strong>programming</strong>{" "}
        stuff I'm tinkering with, and possibly even some{" "}
        <strong>politics/philosophy</strong> (not sure about this yet).
      </p>
    </div>
  );
}

export default Index;
